import{_ as l,c as e,o as r,ab as a}from"./chunks/framework.CUflZczI.js";const c=JSON.parse('{"title":"Реліз 1.13","description":"","frontmatter":{},"headers":[],"relativePath":"uk/releases/1.13.md","filePath":"uk/releases/1.13.md"}'),t={name:"uk/releases/1.13.md"},i=a('<h1 id="реліз-1-13" tabindex="-1">Реліз 1.13 <a class="header-anchor" href="#реліз-1-13" aria-label="Permalink to &quot;Реліз 1.13&quot;">​</a></h1><ul><li><a href="#release-1-13">Реліз 1.13</a><ul><li><a href="#pre-releases">Попередній випуск</a></li><li><a href="#changes">Зміни</a><ul><li><a href="#common">Загальні</a></li><li><a href="#sensors">Сенсори</a></li><li><a href="#hardware">Апаратне забезпечення(Hardware)</a></li><li><a href="#mavlink">MAVLink</a></li><li><a href="#multicopter">Мультикоптер</a></li><li><a href="#vtol">VTOL</a></li><li><a href="#control">Управління</a></li><li><a href="#gps">GPS</a></li><li><a href="#nuttx">NuttX</a></li><li><a href="#can">CAN</a></li></ul></li></ul></li></ul><h2 id="попередніи-випуск" tabindex="-1">Попередній випуск <a class="header-anchor" href="#попередніи-випуск" aria-label="Permalink to &quot;Попередній випуск&quot;">​</a></h2><ul><li><a href="https://github.com/PX4/PX4-Autopilot/releases/tag/v1.13.0-rc1" target="_blank" rel="noreferrer">Реліз-кандидат 1</a></li><li><a href="https://github.com/PX4/PX4-Autopilot/releases/tag/v1.13.0-beta1" target="_blank" rel="noreferrer">Beta 1</a></li></ul><h2 id="зміни" tabindex="-1">Зміни <a class="header-anchor" href="#зміни" aria-label="Permalink to &quot;Зміни&quot;">​</a></h2><h3 id="загальні" tabindex="-1">Загальні <a class="header-anchor" href="#загальні" aria-label="Permalink to &quot;Загальні&quot;">​</a></h3><ul><li><p><strong>Явний вибір джойстика (<a href="https://github.com/PX4/PX4-Autopilot/pull/17404" target="_blank" rel="noreferrer">PR#17404</a>)</strong></p><ul><li>Можливість до: <ul><li>Чітко дозволити лише одне джерело</li><li>Повернутися до іншого джерела у повітрі</li><li>Відключити ввід за допомогою палиці повністю</li></ul></li><li>Параметр конфігурації: <a href="./../advanced_config/parameter_reference.html#COM_RC_IN_MODE">COM_RC_IN_MODE</a></li></ul></li><li><p>Час польоту на основі низького заряду батареї (<a href="https://github.com/PX4/PX4-Autopilot/pull/17828" target="_blank" rel="noreferrer">PR#17828</a>)</p></li><li><p>Час залишкового польоту на основі низького рівня заряду акумулятора RTL (<a href="https://github.com/PX4/PX4-Autopilot/pull/18646" target="_blank" rel="noreferrer">PR#18646</a>)</p></li><li><p>Покращені параметри оцінки резерву батареї (<a href="https://github.com/PX4/PX4-Autopilot/pull/19429" target="_blank" rel="noreferrer">PR#19429</a>, <a href="https://github.com/PX4/PX4-Autopilot/pull/19700" target="_blank" rel="noreferrer">PR#19700</a>)</p></li><li><p>Автономне лагідне приземлення за допомогою датчика відстані (<a href="https://github.com/PX4/PX4-Autopilot/pull/19126" target="_blank" rel="noreferrer">PR#19126</a>)</p></li><li><p>Покращення режиму польоту Орбіту (<a href="https://github.com/PX4/PX4-Autopilot/pull/18988" target="_blank" rel="noreferrer">плавність підхідного курсу</a>, <a href="https://github.com/PX4/PX4-Autopilot/pull/19362" target="_blank" rel="noreferrer">обмеження радіусу</a>, та <a href="https://github.com/PX4/PX4-Autopilot/pull/19367" target="_blank" rel="noreferrer">ручне введення керування з вказівкою не до центру</a>)</p></li></ul><h3 id="сенсори" tabindex="-1">Сенсори <a class="header-anchor" href="#сенсори" aria-label="Permalink to &quot;Сенсори&quot;">​</a></h3><ul><li>Барометр <ul><li>Goertek SPL06 (<a href="https://github.com/PX4/PX4-Autopilot/pull/19229" target="_blank" rel="noreferrer">PR#19229</a>)</li><li>TDK ICP10100 &amp; ICP10111 (<a href="https://github.com/PX4/PX4-Autopilot/pull/18451" target="_blank" rel="noreferrer">PR#18451</a>)</li><li>Maiertek MPC2520 (<a href="https://github.com/PX4/PX4-Autopilot/pull/17910" target="_blank" rel="noreferrer">PR#17910</a>)</li><li>TE MS5837 (<a href="https://github.com/PX4/PX4-Autopilot/pull/19183" target="_blank" rel="noreferrer">PR#19183</a>)</li></ul></li><li>Гігометр <ul><li>Sensirion SHT3X (<a href="https://github.com/PX4/PX4-Autopilot/pull/18910" target="_blank" rel="noreferrer">PR#18910</a>)</li></ul></li><li>IMU <ul><li>TDK ICM42670p (<a href="https://github.com/PX4/PX4-Autopilot/pull/18141" target="_blank" rel="noreferrer">PR#18141</a>)</li><li>BMI088 I2C (Support Improved) (<a href="https://github.com/PX4/PX4-Autopilot/pull/17467" target="_blank" rel="noreferrer">PR#17467</a>)</li></ul></li><li>Оптичний потік(Optical Flow) <ul><li>Pixart PAA3905 (<a href="https://github.com/PX4/PX4-Autopilot/pull/19461" target="_blank" rel="noreferrer">PR#19461</a>)</li></ul></li><li>Монітор живлення <ul><li>TI INA228 (<a href="https://github.com/PX4/PX4-Autopilot/pull/17994" target="_blank" rel="noreferrer">PR#19461</a>)</li><li>TI INA238 (<a href="https://github.com/PX4/PX4-Autopilot/pull/18260" target="_blank" rel="noreferrer">PR#18260</a>)</li></ul></li><li>Інше <ul><li>Захоплення введення GPS PPS (<a href="https://github.com/PX4/PX4-Autopilot/pull/18849" target="_blank" rel="noreferrer">PR#18849</a>)</li><li>NXP Ultra Wide Band (UWB) SR150 (<a href="https://github.com/PX4/PX4-Autopilot/pull/14474" target="_blank" rel="noreferrer">PR#14474</a>)</li></ul></li></ul><h3 id="апаратне-забезпечення" tabindex="-1">Апаратне забезпечення <a class="header-anchor" href="#апаратне-забезпечення" aria-label="Permalink to &quot;Апаратне забезпечення&quot;">​</a></h3><ul><li>ARK CAN RTK GPS (<a href="https://github.com/PX4/PX4-Autopilot/pull/14474" target="_blank" rel="noreferrer">PR#18412</a>)</li><li>ATL Mantis EDU (<a href="https://github.com/PX4/PX4-Autopilot/pull/17910" target="_blank" rel="noreferrer">PR#17910</a>)</li><li>Diatone Mamba f405 mk2 (<a href="https://github.com/PX4/PX4-Autopilot/pull/18402" target="_blank" rel="noreferrer">PR#18402</a>)</li><li>Holybro Kakute H7 (<a href="https://github.com/PX4/PX4-Autopilot/pull/19019" target="_blank" rel="noreferrer">PR#19019</a>)</li><li>Matek GNSS-M9N-F4 (<a href="https://github.com/PX4/PX4-Autopilot/pull/19061" target="_blank" rel="noreferrer">PR#19061</a>)</li><li>Matek H743-slim (<a href="https://github.com/PX4/PX4-Autopilot/pull/18544" target="_blank" rel="noreferrer">PR#18544</a>)</li><li>mRo Control Zero Classic (<a href="https://github.com/PX4/PX4-Autopilot/pull/19593" target="_blank" rel="noreferrer">PR#19593</a>)</li><li>Pixhawk FMUv6C (<a href="https://github.com/PX4/PX4-Autopilot/pull/19544" target="_blank" rel="noreferrer">PR#19544</a>)</li><li>Raspberry Pi Pico (<a href="https://github.com/PX4/PX4-Autopilot/pull/18083" target="_blank" rel="noreferrer">PR#18083</a>)</li><li>Sky Drones SmartAP Airlink (<a href="https://github.com/PX4/PX4-Autopilot/pull/19529" target="_blank" rel="noreferrer">PR#19529</a>)</li></ul><h3 id="mavlink" tabindex="-1">MAVLink <a class="header-anchor" href="#mavlink" aria-label="Permalink to &quot;MAVLink&quot;">​</a></h3><ul><li>Підтримка системи парашутів, запущених MAVLink (<a href="https://github.com/PX4/PX4-Autopilot/pull/18589" target="_blank" rel="noreferrer">PR#18589</a>)</li></ul><h3 id="оцінки" tabindex="-1">Оцінки <a class="header-anchor" href="#оцінки" aria-label="Permalink to &quot;Оцінки&quot;">​</a></h3><ul><li>Керування позицією Бета (<a href="https://github.com/PX4/PX4-Autopilot/pull/18776" target="_blank" rel="noreferrer">PR#18776</a>)</li><li>Оцінки <ul><li>Оцінювач відхилення барометра EKF2</li><li>Перевірка кінематичної послідовності дальномера EKF2</li><li>Коефіцієнт тягового опору моменту пропелера EKF2, який використовується для оцінки вітру у мульти-роторних системах.</li><li>інкрементне автоматичне калібрування прискорювача та гіроскопа</li><li>присвячений оцінювач зміщення магнітометра для легкої калібрування перед польотом</li></ul></li></ul><h3 id="управління" tabindex="-1">Управління <a class="header-anchor" href="#управління" aria-label="Permalink to &quot;Управління&quot;">​</a></h3><ul><li><strong>Динамічне керування розподілом (<a href="https://github.com/PX4/PX4-Autopilot/pull/18776" target="_blank" rel="noreferrer">PR#18776</a>)</strong><ul><li>Вимкнено за замовчуванням, див. <a href="./../config/actuators.html">інструкції з використання</a>, щоб почати роботу</li><li>Проста та гнучка конфігурація приводу</li><li>Підтримка більш широкого спектру апаратного забезпечення без необхідності ручних налаштувань файлу змішувача</li><li>Можливість динамічного налаштування розподілу у польоті, наприклад, втрата ротору</li></ul></li></ul><h3 id="мультикоптер" tabindex="-1">Мультикоптер <a class="header-anchor" href="#мультикоптер" aria-label="Permalink to &quot;Мультикоптер&quot;">​</a></h3><ul><li>автонастройка</li></ul><h3 id="vtol" tabindex="-1">VTOL <a class="header-anchor" href="#vtol" aria-label="Permalink to &quot;VTOL&quot;">​</a></h3><ul><li>автонастройка</li></ul><h3 id="gps" tabindex="-1">GPS <a class="header-anchor" href="#gps" aria-label="Permalink to &quot;GPS&quot;">​</a></h3><h3 id="nuttx" tabindex="-1">NuttX <a class="header-anchor" href="#nuttx" aria-label="Permalink to &quot;NuttX&quot;">​</a></h3><h3 id="can" tabindex="-1">CAN <a class="header-anchor" href="#can" aria-label="Permalink to &quot;CAN&quot;">​</a></h3><ul><li>UAVCANv1, також відомий як OpenCyphal</li><li>DroneCAN <ul><li>Підтримка акумулятора</li><li>Підтримка гігрометра</li><li>Внутрішньосгорювальний двигун (ICE)</li><li>Обробка журналів повідомлень від вузлів CAN</li></ul></li></ul>',25),o=[i];function h(u,n,p,P,s,f){return r(),e("div",null,o)}const g=l(t,[["render",h]]);export{c as __pageData,g as default};
